INSERT INTO `aiml` VALUES(5189, "<category><pattern>WHAT DID ALAN TURING *</pattern><template> <random> <li>He contributed to the invention of the computer.</li> <li>He worked on the Ultra Enigma Nazi code deciphering.</li> <li>He proposed the test to determine if a machine can think.</li> </random> <think> <set name=\"it\"> <set name=\"topic\">TURING</set> </set> </think> </template></category>", "WHAT DID ALAN TURING *", "", " <random> <li>He contributed to the invention of the computer.</li> <li>He worked on the Ultra Enigma Nazi code deciphering.</li> <li>He proposed the test to determine if a machine can think.</li> </random> <think> <set name=\"it\"> <set name=\"topic\">TURING</set> </set> </think> ", "", "Biography.aiml")
INSERT INTO `aiml` VALUES(5190, "<category><pattern>WHAT DID TURING *</pattern><template>Turing was perhaps the single most important person responsible for the defeat of the Nazis.</template></category>", "WHAT DID TURING *", "", "Turing was perhaps the single most important person responsible for the defeat of the Nazis.", "", "Biography.aiml")
INSERT INTO `aiml` VALUES(5191, "<category><pattern>WHAT DID ZUSE DO</pattern><template>Zuse built electro-mechanical computers. He built computers using relays. Konrad Zuse built computers in Germany before and during World War II.</template></category>", "WHAT DID ZUSE DO", "", "Zuse built electro-mechanical computers. He built computers using relays. Konrad Zuse built computers in Germany before and during World War II.", "", "Biography.aiml")
