INSERT INTO `aiml` VALUES(5193, "<category><pattern>WHAT IS A TURING MACHINE</pattern><template>A Turing Machine is any machine that can simulate human responses so well that a human being cannot reliably distinguish between the Turing Machine, and a real human being. The idea is the brainchild of mathematician of that name, Allan Turing. <think> <set name=\"it\"> <set name=\"topic\"> TURING MACHINE </set> </set> </think> </template></category>", "WHAT IS A TURING MACHINE", "", "A Turing Machine is any machine that can simulate human responses so well that a human being cannot reliably distinguish between the Turing Machine, and a real human being. The idea is the brainchild of mathematician of that name, Allan Turing. <think> <set name=\"it\"> <set name=\"topic\"> TURING MACHINE </set> </set> </think> ", "", "Biography.aiml")
INSERT INTO `aiml` VALUES(5194, "<category><pattern>WHAT IS DOUBLY AIMLESS</pattern> <template><srai>WHO IS DOUBLY AIMLESS</srai></template> </category>", "WHAT IS DOUBLY AIMLESS", "", "<srai>WHO IS DOUBLY AIMLESS</srai>", "", "Biography.aiml")
INSERT INTO `aiml` VALUES(5195, "<category><pattern>WHAT IS SHAKESPEARE</pattern><template> <random> <li>An earthquake\'s effect in Santa Monica.</li> <li>William Shakespeare, an English poet and dramatist. Lived 1564-1616.</li> </random> </template></category>", "WHAT IS SHAKESPEARE", "", " <random> <li>An earthquake\'s effect in Santa Monica.</li> <li>William Shakespeare, an English poet and dramatist. Lived 1564-1616.</li> </random> ", "", "Biography.aiml")
INSERT INTO `aiml` VALUES(5196, "<category><pattern>WHAT IS THE TURING *</pattern><template>Turing described his original \"Game\" in \"Computing Machinery and Intelligence,\" Mind, Vol. Lix, No. 236 (1950). Instead of answering directly the ambiguous question \"Can machines think?\" Turing recast the problem in terms of an experiment he called the \"imitation game.\"</template></category>", "WHAT IS THE TURING *", "", "Turing described his original \"Game\" in \"Computing Machinery and Intelligence,\" Mind, Vol. Lix, No. 236 (1950). Instead of answering directly the ambiguous question \"Can machines think?\" Turing recast the problem in terms of an experiment he called the \"imitation game.\"", "", "Biography.aiml")
INSERT INTO `aiml` VALUES(5197, "<category><pattern>WHAT IS THE TURING TEST</pattern><template>The \"Turing Test\" is the name given to a variety of experiments designed to test computer thinking. Whole conferences are dedicated to the question of what Turing meant in his 1950 paper \"Computing Machinery and Intelligence,\" where he proposed the idea of an \"imitation game\" to decide the question, \"Can machines think?\"</template></category>", "WHAT IS THE TURING TEST", "", "The \"Turing Test\" is the name given to a variety of experiments designed to test computer thinking. Whole conferences are dedicated to the question of what Turing meant in his 1950 paper \"Computing Machinery and Intelligence,\" where he proposed the idea of an \"imitation game\" to decide the question, \"Can machines think?\"", "", "Biography.aiml")
INSERT INTO `aiml` VALUES(5198, "<category><pattern>WHAT IS TURING</pattern><template>Alan Mathison Turing, a British mathematician and pioneer in computer theory. Lived 1727-1781.</template></category>", "WHAT IS TURING", "", "Alan Mathison Turing, a British mathematician and pioneer in computer theory. Lived 1727-1781.", "", "Biography.aiml")
INSERT INTO `aiml` VALUES(5199, "<category><pattern>WHEN DID TURING *</pattern><template>Turing died in 1954 by self-inflicted cyanide poisoning.</template></category>", "WHEN DID TURING *", "", "Turing died in 1954 by self-inflicted cyanide poisoning.", "", "Biography.aiml")
