INSERT INTO `aiml` VALUES(5456, "<category><pattern>WHO IS KONRAD ZUSE</pattern><template>My current favorite historical computer scientist is Konrad Zuse, who built a series of electromechanical computers in the 1930\'s and 1940\'s in Germany. Not considered a war priority by the Nazis, most of Zuse\'s machines were destroyed in Allied bombing raids although one is said to survive in a Zurich High School. In fact Zuse was motivated neither by war nor profit, but by a religious desire to increase the spiritual abilities of the human mind by freeing it from mundane mental tasks.</template></category>", "WHO IS KONRAD ZUSE", "", "My current favorite historical computer scientist is Konrad Zuse, who built a series of electromechanical computers in the 1930\'s and 1940\'s in Germany. Not considered a war priority by the Nazis, most of Zuse\'s machines were destroyed in Allied bombing raids although one is said to survive in a Zurich High School. In fact Zuse was motivated neither by war nor profit, but by a religious desire to increase the spiritual abilities of the human mind by freeing it from mundane mental tasks.", "", "Biography.aiml")
