INSERT INTO `aiml` VALUES(5710, "<topic name=\"BLACKJACK\"> <category> <pattern>_</pattern><that>HOW MANY COINS DO YOU WISH TO BET 1 10</that><template> <think> <set name=\"topic\"></set> <set name=\"plbet\"><star/></set> <set name=\"plstake\"><star/></set> <set name=\"bankmessage\">You cannot bet \"<get name=\"plbet\"/> coins\". Please choose a number of coins (1-10) or type QUIT to finish playing.</set> </think> <condition name=\"plbet\"> <li value=\"1\"><srai>BETOK</srai></li> <li value=\"2\"><srai>BETOK</srai></li> <li value=\"3\"><srai>BETOK</srai></li> <li value=\"4\"><srai>BETOK</srai></li> <li value=\"5\"><srai>BETOK</srai></li> <li value=\"6\"><srai>BETOK</srai></li> <li value=\"7\"><srai>BETOK</srai></li> <li value=\"8\"><srai>BETOK</srai></li> <li value=\"9\"><srai>BETOK</srai></li> <li value=\"10\"><srai>BETOK</srai></li> <li value=\"QUIT\">Ok. What would you like to do now?</li> <li><srai>BADBJBET</srai></li> </condition> </template> </category> </topic>", "_", "HOW MANY COINS DO YOU WISH TO BET 1 10", " <think> <set name=\"topic\"></set> <set name=\"plbet\"><star/></set> <set name=\"plstake\"><star/></set> <set name=\"bankmessage\">You cannot bet \"<get name=\"plbet\"/> coins\". Please choose a number of coins (1-10) or type QUIT to finish playing.</set> </think> <condition name=\"plbet\"> <li value=\"1\"><srai>BETOK</srai></li> <li value=\"2\"><srai>BETOK</srai></li> <li value=\"3\"><srai>BETOK</srai></li> <li value=\"4\"><srai>BETOK</srai></li> <li value=\"5\"><srai>BETOK</srai></li> <li value=\"6\"><srai>BETOK</srai></li> <li value=\"7\"><srai>BETOK</srai></li> <li value=\"8\"><srai>BETOK</srai></li> <li value=\"9\"><srai>BETOK</srai></li> <li value=\"10\"><srai>BETOK</srai></li> <li value=\"QUIT\">Ok. What would you like to do now?</li> <li><srai>BADBJBET</srai></li> </condition> ", "BLACKJACK", "Blackjack.aiml")
INSERT INTO `aiml` VALUES(5711, "<category> <pattern>BLACKJACK</pattern> <template> <think> <set name=\"coins\">50</set> <set name=\"bankcoin\">coins</set> </think> Welcome to my Blackjack game. You start the game with <get name=\"coins\"/> coins.<br/><br/> HOUSE RULES:<br/> - Dealer must draw to 17<br/> - Blackjack pays 3 for 2 (rounded up to the nearest coin)<br/> - Maximum bet is 10 coins<br/> - The game ends when you either lose all your coins or break the bank by making 250 coins<br/><br/>Good luck!<br/><br/> Type D to deal. </template> </category>", "BLACKJACK", "", " <think> <set name=\"coins\">50</set> <set name=\"bankcoin\">coins</set> </think> Welcome to my Blackjack game. You start the game with <get name=\"coins\"/> coins.<br/><br/> HOUSE RULES:<br/> - Dealer must draw to 17<br/> - Blackjack pays 3 for 2 (rounded up to the nearest coin)<br/> - Maximum bet is 10 coins<br/> - The game ends when you either lose all your coins or break the bank by making 250 coins<br/><br/>Good luck!<br/><br/> Type D to deal. ", "", "Blackjack.aiml")
INSERT INTO `aiml` VALUES(5712, "<category> <pattern>D</pattern><that>TYPE D TO DEAL</that><template> <think> <set name=\"topic\">BLACKJACK</set> </think> Type \"QUIT\" to end the game.<br/><br/> Bank: <get name=\"coins\"/> <get name=\"bankcoin\"/>.<br/> How many coins do you wish to bet (1-10)? </template> </category>", "D", "TYPE D TO DEAL", " <think> <set name=\"topic\">BLACKJACK</set> </think> Type \"QUIT\" to end the game.<br/><br/> Bank: <get name=\"coins\"/> <get name=\"bankcoin\"/>.<br/> How many coins do you wish to bet (1-10)? ", "", "Blackjack.aiml")
